  [],\n\t\"num_tags\": 7,\n\t\"name\": \"the-relationship-between-the-fluctuations-of-bird-populations-and-the-salinities-of-ponds-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes a bi-monthly census
  of salinities and bird numbers taken in the salt evaporation ponds on the San Francisco
  Bay National Wildlife Refuge. A bi-monthly census of salinities and bird numbers
  was taken to determine if there was a correlation between the bird use and salinity
  of salt evaporation ponds near East Palo Alto. The study was conducted on four salt
  evaporation ponds in San Mateo County, from June 1978 through June 1979. Salinity
  readings were taken from each pond, and the total number of birds per pond was counted.
  The salinities ranged from a low of 50 parts/1,000 in Pond I to a high of 270 parts/1,000
  in Pond IV. Thirty-six species were identified and a total of 49,857 birds were
  counted. Shorebirds, waterfowl, and gulls were the most common species using the
  salt ponds.  The surface-feeding ducks and the phalaropes exhibited a preference
  for Pond I which had the lowest average salinity reading of the four ponds studies.
  The shorebirds, diving ducks, and gulls all showed a high degree of salinity tolerance
  and were found on all ponds. The shorebirds made the heaviest use of ponds which
  were sufficiently shallow for wading regardless of salinities, thus showing a possible
  food foraging preference.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
